import React from "react";
import { Link } from "react-router-dom";

const Navbar = function () {
  return (
    <nav className="navbar has-background-black-ter mb-4">
      <Link to="/">
        <h3 className="navbar-item has-text-white">TMDB</h3>
      </Link>
      <div className="navbar-item navbar-end">
        <Link to="/search">
          <button className="button is-ghost has-text-white">Search</button>
        </Link>

      </div>
      <div className="navbar-item navbar-end has-text-white">
        <Link to = "/login">
        <button className="button is-white">Login</button>

        </Link>
        <button className="button is-white">Register</button>
      </div>
    </nav>
  );
};

export default Navbar;
